import VueRouter from "vue-router";
import Grounding from "../pages/Grounding.vue";
import Vue from "vue";
Vue.use(VueRouter);
const router = new VueRouter({
    routes:[
        {
            name:"grouping",
            path:"/grouping",
            component:Grounding
        },
    ]
});
export default router;
